window.bookSummaryJSON = "<p>When 16-year-old Jack forgets to take his medicine one morning, he soon learns what the medicine is really for. It's a suppressant for his magical powers....He's a Warrior Heir. He soon finds out that his parents were waiting for his wizard to come and begin his training for a tournament to the death before they revealed the truth to him. If Jack wants to make it, he's going to need the help of friends - both magic and normal - and to learn to use his warrior powers and believe in himself.</p>"; 
